import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Login from "./components/Login";
import Register from "./components/Register";
import Home from "./components/Student/Home";
import About from "./components/Student/About";
import Class from "./components/Student/Class";
import Profile from "./components/Student/Profile";
import Detail from "./components/Student/Detail";

import HomeTutor from "./components/Tutor/HomeTutor";
import AboutTutor from "./components/Tutor/AboutTutor";
import ClassTutor from "./components/Tutor/ClassTutor";
import DetailTutor from "./components/Tutor/DetailClassTutor";
import ProfileTutor from "./components/Tutor/ProfileTutor";
import CreateClassTutor from "./components/Tutor/CreateClassTutor";
import EditClassTutor from "./components/Tutor/EditClassTutor";
// import Dashboard from './components/Dashboard';

import PrivateRoute from "./components/PrivateRoute";
import EditProfileTutor from "./components/Tutor/EditProfileTutor";

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />

        <Route
          path="/home"
          element={
            <PrivateRoute>
              <Home />
            </PrivateRoute>
          }
        />
        <Route
          path="/about"
          element={
            <PrivateRoute>
              <About />
            </PrivateRoute>
          }
        />
        <Route
          path="/class"
          element={
            <PrivateRoute>
              <Class />
            </PrivateRoute>
          }
        />
        <Route
          path="/profile"
          element={
            <PrivateRoute>
              <Profile />
            </PrivateRoute>
          }
        />
        <Route
          path="/class/:class_id"
          element={
            <PrivateRoute>
              <Detail />
            </PrivateRoute>
          }
        />

        <Route
          path="/tutorhome"
          element={
            <PrivateRoute>
              <HomeTutor />
            </PrivateRoute>
          }
        />
        <Route
          path="/tutorabout"
          element={
            <PrivateRoute>
              <AboutTutor />
            </PrivateRoute>
          }
        />
        <Route
          path="/tutorclass"
          element={
            <PrivateRoute>
              <ClassTutor />
            </PrivateRoute>
          }
        />
        <Route
          path="/tutorclass/:class_id"
          element={
            <PrivateRoute>
              <DetailTutor />
            </PrivateRoute>
          }
        />
        <Route
          path="/tutor/profile"
          element={
            <PrivateRoute>
              <ProfileTutor />
            </PrivateRoute>
          }
        />
        <Route
          path="/create-class"
          element={
            <PrivateRoute>
              <CreateClassTutor />
            </PrivateRoute>
          }
        />
          <Route
            path="/tutorprofile/edit/:class_id"
            element={
              <PrivateRoute>
                <EditClassTutor />
              </PrivateRoute>
            }
          />
        <Route
          path="/tutorprofile/edit/:tutor_id"
          element={
            <PrivateRoute>
              <EditProfileTutor />
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  );
};

export default App;
